import React from "react";
import "./SuccessMessage.css";

interface SuccessMessageProps {
  message: string;
}

export const SuccessMessage = ({ message }: SuccessMessageProps) => {
  return (
    <div className="message__success">
    {message}
      <div>Success!</div>
      <div>{message}</div>
    </div>
  );
};
